import React from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import '../css/Tab.css';
import UserSets from './UserSets';


const FlashcardTabs = () => (
    <Tabs>
      <TabList>
        <Tab>Your Sets</Tab>
        <Tab>Group Sets</Tab>
        <Tab>Public Sets</Tab>
      </TabList>

      <TabPanel>
        <UserSets />
        {currentUser.sets.map(s => <SetCard set={s} />)}
      </TabPanel>
      <TabPanel>
        <h2>List of sets from groups user is in </h2>
      </TabPanel>
      <TabPanel>
        <h2>First 10 public sets</h2>
      </TabPanel>
    </Tabs>
  );

  export default FlashcardTabs
